Given the equation \( z + \frac{1}{z} = \frac{1 + \sqrt{5}}{2} \), we recognize that \( z \) is a root of the quadratic equation \( z^2 - \left( \frac{1 + \sqrt{5}}{2} \right) z + 1 = 0 \). Solving this quadratic equation using the quadratic formula \( z = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a} \), where \( a = 1 \), \( b = -\frac{1 + \sqrt{5}}{2} \), and \( c = 1 \), we get:

\[
z = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\left( \frac{1 + \sqrt{5}}{2} \right)^2 - 4}}{2}
\]

Simplifying inside the square root:

\[
z = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\frac{1 + 2\sqrt{5} + 5}{4} - 4}}{2 } = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\frac{6 + 2\sqrt{5} - 16}{4}}}{2} = \frac{\frac{1 + \sqrt{5}}{2} \pm \sqrt{\frac{-10 + 2\sqrt{5}}{4}}}{2} = \frac{\frac{1 + \sqrt{5}}{2} \pm \frac{\sqrt{2\sqrt{5} - 10}}{2}}{2} = \frac{1 + \sqrt{5} \pm \sqrt{2\sqrt{5} - 10}}{4}
\]

However, we recognize that \( z \) is a complex number on the unit circle, so \( z = e^{i\theta} \) where \( \theta \) is the argument of \( z \). From the given equation, we know:

\[
z + \frac{1}{z} = 2 \cos \theta = \frac{1 + \sqrt{5}}{2}
\]

Thus,

\[
\cos \theta = \frac{1 + \sqrt {5}}{4}
\]

The angle \( \theta \) is \( \frac{\pi}{5} \) or \( -\frac{\pi}{5} \) because \( \cos \left( \frac{\pi}{5} \right) = \frac{1 + \sqrt{5}}{4} \). Therefore, \( z = e^{i\pi/5} \) or \( z = e^{-i\pi/5} \).

We need to find \( z^{85} + \frac{1}{z^{85}} \). If \( z = e^{i\pi/5} \), then \( z^{85} = \left( e^{i\pi/5} \right)^{85} = e^{i17\pi} = e^{i(16\pi + \pi)} = e^{i\pi} = -1 \). Similarly, if \( z = e^{-i\pi/5} \), then \( z^{85} = \left( e^{-i\pi/5} \right)^{85} = e^{-i17\pi} = e^{-i(16\ pi + \pi)} = e^{-i\pi} = -1 \).

In both cases, we have \( z^{85} = -1 \) and \( \frac{1}{z^{85}} = -1 \), so:

\[
z^{85} + \frac{1}{z^{85}} = -1 + (-1) = -2
\]

Thus, the answer is:

\[
\boxed{-2}
